{"name": "ED治療薬", "url": "javascript:void(0)", "description": "バイアグラ系バイアグラは、大手製薬会社ファイザー社が開発。世界で初めて製造販売されたED（勃起不全）治療薬です。


            
性行為の1時間前に服用することで、有効成分シルデナフィルが陰茎の血管を拡げて鋭く力強い勃起力を発揮します。約5時間の持続効果が見込めます。
         
            
人気のカマグラシリーズなど、さまざまな剤形タイプのジェネ", "image_url": "https://okusuritsuhan.shop/file/topSliderImg/22/22.webp", "category_url": "/search?AMI=1"}

{"name": "AGA治療薬", "url": "javascript:void(0)", "description": "プロペシア系プロペシアは、MSDが開発したAGA（男性型脱毛症）に有効な治療薬です。2021年からOrganonの製造になりました。

    
効果・安全性がともに高く、薄毛の進行を高確率で止める効果があるとされており、AGA症状の根本的改善と治療が望めます。

    
主成分フィナステリドは症状の原因となる男性ホルモンを抑制し、抜け毛の予防だけでなく、生えてきた毛を強い髪質に変え", "image_url": "https://okusuritsuhan.shop/file/topSliderImg/22/22.webp", "category_url": "/search?AMI=6"}
